  disp[3] = ${ui_disp_4_turbout};
  disp[4] = ${ui_disp_5_turbout};
  disp[5] = ${ui_disp_6_turbout};
  disp[6] = ${ui_disp_7_turbout};
  disp[7] = ${ui_disp_8_turbout};
  disp[8] = ${ui_disp_9_turbout};

  ${f_turb_tou_periods} = disp;  

  ${F_wc} =
	[
	${hybrid_tou1},
	${hybrid_tou2},
	${hybrid_tou3},
	${hybrid_tou4},
	${hybrid_tou5},
	${hybrid_tou6},
	${hybrid_tou7},
	${hybrid_tou8},
	${hybrid_tou9}
	];

};

Callbacks:
on_load{ 'Phys Trough Dispatch Control' } = define() {

  fin = financing();
  if ( fin == "Commercial" || fin == "None") 
    show( 'copy_schedule', false );

	//mode = value("csp.pt.pwrb.condenser_type");
	mode = 0;  // just setting a non-hybrid condenser

	enable("hybrid_tou1", mode==2);
	enable("hybrid_tou2", mode==2);
	enable("hybrid_tou3", mode==2);
	enable("hybrid_tou4", mode==2);
	enable("hybrid_tou5", mode==2);
	enable("hybrid_tou6", mode==2);
	enable("hybrid_tou7", mode==2);
	enable("hybrid_tou8", mode==2);
	enable("hybrid_tou9", mode==2);

};

on_change{ 'copy_schedule' } = define() {

    value( 'weekday_schedule' , value ( 'dispatch_sched_weekday' ) );
    value( 'weekend_schedule' , value ( 'dispatch_sched_weekend' ) );

};
